import CardTitleTextName from "../components/common/CardTitleTextName";
import Footer from "../components/Footer";
import Header from "../components/header/Header";
import ReactSlick from "../components/ReactSlick";
import "../styles/banner.css";
import "../styles/main.css";
import dummy from "../json/cardText.json";
import { ReactComponent as RoundQSvg } from "../svg/roundQ.svg";
import MenuSlider from "../components/common/MenuSlider";

const MainPage = () => {
  const card = dummy.card;
  const cardList = card.map((cardText, index) => (
    <CardTitleTextName
      key={index}
      img={cardText.img}
      title={cardText.title}
      text={cardText.text}
      icon={cardText.icon}
      name={cardText.name}
    />
  ));

  return (
    <div>
      <Header />
      <main className="main">
        <ReactSlick />
        <section className="career">
          <div className="career_div">
            <div className="career_div_title">
              <h2>나에게 필요한 커리어 인사이트</h2>
              <button>
                <RoundQSvg />
              </button>
            </div>
            <div className="career_div_list">
              <MenuSlider />
            </div>
            <ul className="career_div_ul">{cardList}</ul>
            <div className="career_div_more">
              <button>
                <span className="career_div_more_span">
                  더 많은 콘텐츠 보기
                  <span className="career_div_more_span_1">
                    <span>
                      <svg
                        className="SvgIcon_SvgIcon__root__svg__DKYBi"
                        viewBox="0 0 19 19"
                      >
                        <path
                          d="M2.71967 5.71967C2.98594 5.4534 3.4026 5.4292 3.69621 5.64705L3.78033 5.71967L9.499 11.438L15.2162 5.7211C15.4824 5.45479 15.899 5.43051 16.1927 5.64832L16.2768 5.72092C16.5431 5.98715 16.5674 6.40381 16.3496 6.69745L16.277 6.78158L10.0304 13.0302C9.76416 13.2966 9.34745 13.3208 9.0538 13.103L8.96967 13.0303L2.71967 6.78033C2.42678 6.48744 2.42678 6.01256 2.71967 5.71967Z"
                          fill="currentColor"
                        ></path>
                      </svg>
                    </span>
                  </span>
                </span>
              </button>
            </div>
          </div>
        </section>
        <div className="dirline">
          <hr />
        </div>
        <section className="section4li">카드세션</section>
        <div className="dirline">
          <hr />
        </div>
        <section className="section4li">카드세션</section>
        <div className="blueBanner">블루배너</div>
        <section className="section2li">카드세션</section>
        <section className="subBanner">배너</section>
        <section className="companyinfo">회사정보</section>
        <Footer />
      </main>
    </div>
  );
};

export default MainPage;
